import { FC } from 'react';
import Link from 'next/link';
import { StarFilled } from '@ant-design/icons';

interface P {
  repo: {
    login: string;
    name: string;
    full_name: string;
    description: string;
    license: {
      spdx_id: number;
    };
    updated_at: Date;
    open_issues_count: number;
    language: string;
    stargazers_count: number;
  };
}

const Repo: FC<P> = ({ repo }) => {
  const {
    login,
    name,
    description,
    license,
    updated_at,
    open_issues_count,
    language,
    stargazers_count,
  } = repo;
  return (
    <div>
      <div className="repo-info">
        <h3 className="repo-title">
          <Link href={`/detail?owner=${login}&name=${name}`}>
            <a>{name}</a>
          </Link>
        </h3>
        <p className="repo-desc">{description}</p>
        <p className="other-info">
          <span className="last-updated">{updated_at}</span>
          <span className="open-issues">{open_issues_count}</span>
        </p>
      </div>
      <div className="repo-bottom">
        <span className="language">{language}</span>
        <span className="license">{license.spdx_id}</span>
        <span className="stars">
          {stargazers_count}
          <StarFilled />
        </span>
      </div>
      <style jsx>
        {`
          .repo-title {
            font-size: 20px;
          }
          .repo-desc {
            width: 400px;
          }
          .repo-bottom {
            display: flex;
          }
        `}
      </style>
    </div>
  );
};

export default Repo;
